import React, { Component } from 'react';
import { Container,Row,Col } from 'react-bootstrap';
import user1 from './images/user1.png';

export default class FriendsTab extends Component {
  render() {
    return (
      <div>
        <Container>
          <h1>Friends</h1>
          <Row>
            <Col>
              <div>
                <img src={user1} alt="user1"/>

              </div>
            </Col>
            <Col>

            </Col>
            <Col>

            </Col>
          </Row>
          </Container>
      </div>
    )
  }
}
